#include <fstream>
#include <vector>
#include <stack>

using namespace std;

int main() {
    ifstream in("paranteze.in");
    ofstream out("paranteze.out");

    int n;
    in >> n;

    for (int i = 0; i < n; i++) {
        int l;
        in >> l;

        vector<int> paranteze(l);
        for (int j = 0; j < l; j++) {
            in >> paranteze[j];
        }

        stack<int> s;
        bool corect = true;
        for (int j = 0; j < l; j++) {
            if (paranteze[j] % 2 == 0) {
                s.push(paranteze[j]);
            } else {
                if (s.empty() || s.top() != paranteze[j] - 1) {
                    corect = false;
                    break;
                } else {
                    s.pop();
                }
            }
        }

        if (corect && s.empty()) {
            out << "Da" << endl;
        } else {
            out << "Nu" << endl;
        }
    }

    return 0;
}
